};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`The `}<strong parentName="p">{`Test History`}</strong>{` page available within the `}<strong parentName="p">{`Insights`}</strong>{` submenu of the Sauce Labs dashboard shows a visual snapshot of the results for a specific test over time. Seeing the test outcomes in a scatter plot helps reveal anomalies and patterns, which can help you identify issues with test performance and flakiness across platforms, operating systems, and browsers that you test against.`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`NOTE:`}</strong>{` The Extended Debugging feature provides access to the HAR files and JavaScript console logs for your tests to help identify flaky tests. Check out `}<a parentName="p" {...{
          "href": "https://wiki.saucelabs.com/pages/viewpage.action?pageId=70072943"
        }}>{`Debugging Tests with JavaScript Console Logs and HAR Files (Extended Debugging)`}</a>{` for more information.`}</p>
    </blockquote>
    <h2 {...{
      "id": "access-the-history-page-for-a-test"
    }}>{`Access the History Page for a Test`}</h2>
    <ol>
      <li parentName="ol">{`From the Sauce Labs dashboard, click the `}<strong parentName="li">{`Insights`}</strong>{` tab to open its submenu.`}</li>
      <li parentName="ol">{`Click `}<strong parentName="li">{`Test History`}</strong>{`.`}</li>
      <li parentName="ol">{`Use the `}<a parentName="li" {...{
          "href": "/insights/scope#using-filters-to-adjust-the-scope-of-your-data"
        }}>{`filters`}</a>{` to reduce the list of tests to a limited range.`}</li>
      <li parentName="ol">{`In the `}<strong parentName="li">{`Search`}</strong>{` field, enter the name of the test you want to view.  If you're not sure, entering just the first few characters will bring up a list from which you can choose.`}</li>
    </ol>
    <h2 {...{
      "id": "reading-the-scatter-plot-visualization"
    }}>{`Reading the Scatter Plot Visualization`}</h2>
    <p>{`The test performance visualization displays a scatter plot of each iteration of the test that was executed during the specified date filter and matches other filter criteria. At the top of the visualization are four performance statistics for the test iterations shown:`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`Total Runs`}</strong>{` - total number of test runs for the selected period`}</li>
      <li parentName="ul"><strong parentName="li">{`Total Errors`}</strong>{` - total number of test runs that did not complete`}</li>
      <li parentName="ul"><strong parentName="li">{`Total Failures`}</strong>{` - total number of test runs that have a recorded status of "Failed"`}</li>
      <li parentName="ul"><strong parentName="li">{`Average Runtime`}</strong>{` - the mean runtime of all tests shown in the results`}</li>
    </ul>
    <p>{`Below the performance statistics, the scatter plot shows each instance of the test, color-coded by run status, against the time it took the test to either execute or fail. The X-axis indicates the time range that has been selected using the time filter. The Y-axis indicates the duration of the test each time it was run. You can see the specific information about the platform, operating system, and other capabilities specified in a test by hovering your mouse cursor over the point representing it on the plot.`}</p>
    <h2 {...{
      "id": "using-test-history-to-spot-flaky-tests"
    }}>{`Using Test History to Spot Flaky Tests`}</h2>
    <p>{`The charting of errors and failures in the visualization can help you get an early assessment of flaky test behavior. In this example, the test constantly fails in the first and second re-run, and succeeds in the third.  This is a very typical example of a flaky behavior.`}</p>
    <img src={useBaseUrl('img/insights/test-history-flaky.png')} alt="Flaky Test Example" width="650" />
    <h2 {...{
      "id": "an-example-of-using-test-history"
    }}>{`An Example of Using Test History`}</h2>
    <p>{`In this example, you can see how the test `}<strong parentName="p">{`addOneItemtoCart`}</strong>{` was executed over the last seven days on different platforms. Along the bottom are the executions that have successfully run and passed, and have the fastest execution times. As the execution time increases, you can see that there are significantly more runs that have failed. Hovering over a few of the failed tests indicates that many of the failures are on the Chrome browser.`}</p>
    <img src={useBaseUrl('img/insights/test-history-fails.png')} alt="Test Overview with Failures" width="650" />
    <p>{`Applying a filter for Chrome browser, you can now see that the test is clearly failing specifically in that environment.`}</p>
    <img src={useBaseUrl('img/insights/test-history-chrome.png')} alt="Isolated Failures on Chrome" width="650" />
    <p>{`Comparing the two graphs, you can see that the majority of failing tests begin on November 6 and are run on Chrome, so now you can dig into what changes in your test at that time that might have contributed to these failures.`}</p>
    </MDXLayout>;
}

